import React from "react";

const AllWishLists = () => {
  let things = props.wishList.map((d, i) => {
    return (
      <li key={i}>
        name: {d.name}- Check in :{d.checkIn} - Check Out:
        {d.checkOut}
      </li>
    );
  });
  return (
    <div>
      {things}
      <button>add to list</button>
    </div>
  );
};

export default AllWishLists;
